  ticket_text58: '–í–Ω–æ—Å–∏—Ç–µ –º–æ–Ω–µ—Ç—ã "FLOW" –≤ Blocto, –∫–æ—à–µ–ª–µ–∫ Flow, –∏–ª–∏ –ø–æ–∫—É–ø–∞–π—Ç–µ –º–æ–Ω–µ—Ç—ã "FLOW" –≤ –ø—Ä–∏–ª–æ–∂–µ–Ω–∏–∏ Blocto —Å –ø–æ–º–æ—â—å—é MoonPay.',
