  ticket_text63: '–†–µ—à–∏—Ç–µ, –≤ —á–µ–º –∑–∞–∫–ª—é—á–∞–µ—Ç—Å—è –≤–∞—à –±–∏–∑–Ω–µ—Å. –í—ã –º–æ–∂–µ—Ç–µ –∏—Å–ø–æ–ª—å–∑–æ–≤–∞—Ç—å –ª—é–±–æ–π –∏–Ω—Å—Ç—Ä—É–º–µ–Ω—Ç –¥–ª—è –≤—ã–¥–∞—á–∏ –±–∏–ª–µ—Ç–æ–≤ –Ω–∞ –ø–æ–ª—É—á–µ–Ω–∏–µ –Ω–∞–≤—ã–∫–æ–≤; –µ—Å–ª–∏ —ç—Ç–æ Zoom, —Ç–æ –ø—Ä–µ–¥–º–µ—Ç–æ–º –±–∏–ª–µ—Ç–∞ –±—É–¥–µ—Ç –∫–æ–¥ –ø—Ä–∏–≥–ª–∞—à–µ–Ω–∏—è Zoom.',
