  ticket_text67: '–ó–∞–∫–∞–∑—á–∏–∫ –∏—Å–ø–æ–ª—å–∑—É–µ—Ç –∫–Ω–æ–ø–∫—É "–ò—Å–ø–æ–ª—å–∑–æ–≤–∞—Ç—å –±–∏–ª–µ—Ç", —á—Ç–æ–±—ã –ø–æ—Å–µ—Ç–∏—Ç—å –º–µ—Ä–æ–ø—Ä–∏—è—Ç–∏–µ, –ø—Ä–µ–¥–ª–∞–≥–∞–µ–º–æ–µ –æ—Ä–≥–∞–Ω–∏–∑–∞—Ç–æ—Ä–æ–º. –í —ç—Ç–æ –≤—Ä–µ–º—è –∫–æ–Ω—Ñ–∏–¥–µ–Ω—Ü–∏–∞–ª—å–Ω–∞—è –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏—è, –∑–∞—Ä–µ–≥–∏—Å—Ç—Ä–∏—Ä–æ–≤–∞–Ω–Ω–∞—è –æ—Ä–≥–∞–Ω–∏–∑–∞—Ç–æ—Ä–æ–º, –ø–µ—Ä–µ–¥–∞–µ—Ç—Å—è –∑–∞–∫–∞–∑—á–∏–∫—É. –ö—Ä–æ–º–µ —Ç–æ–≥–æ, –µ—Å–ª–∏ –ø–æ—Å–ª–µ –≤—Ä–µ–º–µ–Ω–∏ –Ω–∞—á–∞–ª–∞ –º–µ—Ä–æ–ø—Ä–∏—è—Ç–∏—è –ø—Ä–æ—Ö–æ–¥–∏—Ç —á–∞—Å –±–µ–∑ –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏—è –±–∏–ª–µ—Ç–∞, –±–∏–ª–µ—Ç —Å—Ç–∞–Ω–æ–≤–∏—Ç—Å—è –Ω–µ–¥–µ–π—Å—Ç–≤–∏—Ç–µ–ª—å–Ω—ã–º.',
  ticket_text68: '–ß–µ–ª–æ–≤–µ–∫, –∏—Å–ø–æ–ª—å–∑—É—é—â–∏–π –±–∏–ª–µ—Ç, –ø–æ–ª—É—á–∞–µ—Ç –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏—é –æ –º–µ—Ä–æ–ø—Ä–∏—è—Ç–∏–∏, –ø—Ä–µ–¥–ª–æ–∂–µ–Ω–Ω—É—é –æ—Ä–≥–∞–Ω–∏–∑–∞—Ç–æ—Ä–æ–º. –≠—Ç–æ –º–æ–∂–µ—Ç –±—ã—Ç—å –∫–æ–¥ –ø—Ä–∏–≥–ª–∞—à–µ–Ω–∏—è Zoom –∏–ª–∏ –ª—é–±–∞—è –¥—Ä—É–≥–∞—è –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏—è.',
  ticket_text69: '–í—ã –º–æ–∂–µ—Ç–µ —É–∫–∞–∑–∞—Ç—å —Å—É–º–º—É –≤–æ–∑–≤—Ä–∞—Ç–∞ –≤ –ø—Ä–µ–¥–µ–ª–∞—Ö —Ü–µ–Ω—ã, —É–ø–ª–∞—á–µ–Ω–Ω–æ–π –∑–∞ –º–æ–Ω–µ—Ç—ã "FLOW" –≤–º–µ—Å—Ç–µ —Å –±–∏–ª–µ—Ç–æ–º. (–ö—Ä–∞—É–¥—Ñ–∞–Ω–¥–∏–Ω–≥ —Ç–∞–∫–∂–µ –ø–æ–¥–ª–µ–∂–∏—Ç –≤–æ–∑–≤—Ä–∞—Ç—É).',
  ticket_text70: '–ö–∞–∫ —Ç–æ–ª—å–∫–æ –≤–æ–∑–≤—Ä–∞—Ç —Å—Ä–µ–¥—Å—Ç–≤ –±—É–¥–µ—Ç –æ—Å—É—â–µ—Å—Ç–≤–ª–µ–Ω, –≤ —Ç–µ—á–µ–Ω–∏–µ –Ω–µ—Å–∫–æ–ª—å–∫–∏—Ö –¥–µ—Å—è—Ç–∫–æ–≤ —Å–µ–∫—É–Ω–¥ –≤ –∫–æ—à–µ–ª—å–∫–µ –∫–ª–∏–µ–Ω—Ç–∞ –º–æ–∂–Ω–æ –±—É–¥–µ—Ç —É–≤–∏–¥–µ—Ç—å –±–∞–ª–∞–Ω—Å, –≤–∫–ª—é—á–∞—è –≤–æ–∑–≤—Ä–∞—â–µ–Ω–Ω—É—é —Å—É–º–º—É.',
  ticket_text71: '–î–ª—è —Ç–æ–≥–æ —á—Ç–æ–±—ã –æ—Å—É—â–µ—Å—Ç–≤–∏—Ç—å –≤–æ–∑–≤—Ä–∞—Ç, –∫–ª–∏–µ–Ω—Ç –¥–æ–ª–∂–µ–Ω –Ω–∞—Å—Ç—Ä–æ–∏—Ç—å –≤–æ–∑–≤—Ä–∞—Ç —Ç–æ–ª—å–∫–æ –æ–¥–∏–Ω —Ä–∞–∑, –≤—ã–±—Ä–∞–≤ –ù–∞—Å—Ç—Ä–æ–π–∫–∏ –∏–∑ –º–µ–Ω—é –≤ –ø—Ä–∞–≤–æ–º –≤–µ—Ä—Ö–Ω–µ–º —É–≥–ª—É.',
