  ticket_text73: '–≠—Ç–∞ —É—Å–ª—É–≥–∞ –∏—Å–ø–æ–ª—å–∑—É–µ—Ç –±–ª–æ–∫—á–µ–π–Ω. –ü–æ—ç—Ç–æ–º—É –∫–ª–∏–µ–Ω—Ç–∞–º –Ω–µ–æ–±—Ö–æ–¥–∏–º–æ –∏–º–µ—Ç—å –∫–æ—à–µ–ª–µ–∫. –ï—Å–ª–∏ —É –≤–∞—Å –µ—â–µ –Ω–µ—Ç –∫–æ—à–µ–ª—å–∫–∞, –≤—ã –º–æ–∂–µ—Ç–µ —Å–æ–∑–¥–∞—Ç—å –µ–≥–æ –Ω–∞ —ç—Ç–æ–π –≤–µ–±-—Å—Ç—Ä–∞–Ω–∏—Ü–µ, –∞ —É–ø—Ä–∞–≤–ª—è—Ç—å —Å–≤–æ–∏–º–∏ —Å—Ä–µ–¥—Å—Ç–≤–∞–º–∏ –≤—ã –º–æ–∂–µ—Ç–µ —Å –ø–æ–º–æ—â—å—é –ø—Ä–∏–ª–æ–∂–µ–Ω–∏—è.',
