  operation_text119: '–≠—Ç–æ—Ç –ø—Ä–æ—Ü–µ—Å—Å –ø—Ä–∏–≤—è–∑—ã–≤–∞–µ—Ç –ø–æ–ª—É—á–∞—Ç–µ–ª—è –≤–æ–∑–≤—Ä–∞—Ç–∞ –∫ –∏–¥–µ–Ω—Ç–∏—Ñ–∏–∫–∞—Ç–æ—Ä—É –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—è. –≠—Ç–æ—Ç –ø—Ä–æ—Ü–µ—Å—Å –Ω–µ–æ–±—Ö–æ–¥–∏–º–æ –≤—ã–ø–æ–ª–Ω–∏—Ç—å —Ç–æ–ª—å–∫–æ –æ–¥–∏–Ω —Ä–∞–∑. –°–≤—è–∑–∞–≤ –ø–æ–ª—É—á–∞—Ç–µ–ª—è –≤–æ–∑–≤—Ä–∞—Ç–∞ —Å –∏–¥–µ–Ω—Ç–∏—Ñ–∏–∫–∞—Ç–æ—Ä–æ–º –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—è, –æ—Ä–≥–∞–Ω–∏–∑–∞—Ç–æ—Ä –º–æ–∂–µ—Ç –æ–±—Ä–∞–±–æ—Ç–∞—Ç—å –≤–æ–∑–≤—Ä–∞—Ç –æ–¥–Ω–∏–º –Ω–∞–∂–∞—Ç–∏–µ–º –∫–Ω–æ–ø–∫–∏.',
  operation_text120: '–ó–∞ —ç—Ç–æ—Ç –ø—Ä–æ—Ü–µ—Å—Å –≤–∑–∏–º–∞–µ—Ç—Å—è —Å–ª–µ–¥—É—é—â–∞—è –ø–ª–∞—Ç–∞:', // Âæå„Çç„Å´" $"„Çí„Å§„Åë„Çã„Å®ÁøªË®≥„Åó„ÇÑ„Åô„ÅÑ
  operation_text121: '–°–æ–≥–ª–∞—Å–∏—Ç–µ—Å—å',
  operation_text122: '–ê–¥—Ä–µ—Å –≤–æ–∑–≤—Ä–∞—Ç–∞ –∏ –∏–¥–µ–Ω—Ç–∏—Ñ–∏–∫–∞—Ç–æ—Ä –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—è —É–∂–µ —Å–≤—è–∑–∞–Ω—ã. –î–æ–ø–æ–ª–Ω–∏—Ç–µ–ª—å–Ω–∞—è –æ–±—Ä–∞–±–æ—Ç–∫–∞ –Ω–µ —Ç—Ä–µ–±—É–µ—Ç—Å—è.',
